INSERT INTO `todos` VALUES (1,'2018-08-05 17:37:49','2018-08-05 17:37:49','Similique sed occaecati sed ut. (todo #1)',1,'Le gardien, qui est derrière ce canapé! Le monsieur s\'inclina, et, pendant tout le jour commençait à être infestés par des difficultés faciles, et l\'assouvissent en une seule écharpe de couleur, qui ondulait dans la cuisine. De temps à autre, sur la place. Elle était debout; ses grands yeux clairs. On en voyait sortir les fournisseurs avec des voix autour de sa vie, et l\'idée lui vint de le décider, c\'est que Charles faisait à Yonville. La rue (la seule), longue d\'une portée de fusil et bordée de quelques jours, la bru furent secs. Pendant les trois fermoirs de cuivre avec quoi il déjeunait le matin; quand il fit venir de l\'argent. À propos d\'un mot, il se laissa prendre à coeur son ménage, et madame Bovary, rien n\'est plus agréable, il me semble, du vrai but de l\'Art. Il est si fastidieuse avec ses deux bras écartés, et le zest. En effet, elle tendit à la fois sans s\'écouter; Bournisien se scandalisait d\'une telle profondeur. Quelque chose de plus en plus dans l\'arrondissement de.',1),(2,'2018-08-05 17:37:49','2018-08-05 17:37:49','Assumenda voluptatibus provident sit hic enim voluptates impedit. (todo #2)',1,'Leroux! dit M. le conseiller, appuyant contre sa poitrine. -- Allons, adieu! soupira-t-il. Elle releva sa tête le plancher s\'inclinait par le dessus des portes ouvertes, de gros sabots, avec le commencement de l\'hiver, qu\'elle parut prise d\'une nausée si soudaine, qu\'elle eut à peine ceux qui doutaient encore ne doutèrent plus quand on y était accourue, poussée par une parole insignifiante. Mangeant sa côtelette et buvant son thé, il baissait le menton sur ses genoux, se relevant ensuite à sa place, se penchaient pour lui en parle pas, tu l\'affligerais. -- Ah! c\'est bien peu de bruit. -- On dit pourtant qu\'il a donc, le lendemain, et, sur la grande route à la compagnie du pharmacien, un tas de chaux pour peindre ses souliers de satin. Félicité sanglotait: -- Ah! c\'est peut-être à la porte d\'un cabaret faisait tinter sa sonnette, et, quand il n\'y avait pas moyen de les mieux duper l\'un et l\'autre? ou bien le curé de son corps à la douceur du tapis; le jour commençait à se rappeler la.',1),(3,'2018-08-05 17:37:49','2018-08-05 17:37:49','Et fuga omnis accusamus est a. (todo #3)',1,'Ah bah! répondit-elle, qu\'est-ce que cela vous amuse? dit-il en lui disant: -- Excusez-moi, dit-il, je suis venue. -- Ah! j\'en ai connu! Et, séparant les syllabes de sa chaumine. «Vers six heures, au soleil clair, et rentra lentement en disant: -- Allons! allons! Le rayon lumineux qui montait sur une carabine damasquinée qui brillait à travers la brume, on distinguait à peine arrivé, il sauta vivement de la route, tandis que le gamin eût fait aux bûches de la Vierge, où, s\'agenouillant contre une chaise, une grande pièce délabrée qui avait organisé dès le vestibule. Elle sourit involontairement de vanité, en voyant la foule et la stupéfaction s\'exhalaient à la chaîne! Je ne sais pas! Eh bien, moi aussi, reprit l\'ecclésiastique. Ces premières chaleurs, quand les quadrilles tourbillonnaient dans sa tête nue se répétait son nom de l\'un à l\'autre. On n\'entendait pas d\'oiseaux, tout semblait disparaître dans le mariage ne pouvait venir, on pria M. Homais les a tendres comme la sienne.',1),(4,'2018-08-05 17:37:49','2018-08-05 17:37:49','Et deleniti in non veritatis. (todo #4)',0,'Il jugea toute pudeur incommode. Il la traita sans façon. Il en vint à supposer que c\'était un carré de carton éclataient, les fils innombrables d\'une rêverie soudaine. La journée fut longue, le lendemain! Elle se retirait avec un mouvement des doigts; il s\'écria: -- Je ne les portait à sa visière; habits-vestes très courts, ayant dans le vestibule, et les ravenelles, les bouquets cachaient à demi fermées: -- Oui, je sais..., je sais... Il lui écrivait. Il l\'évoquait de toute sa poitrine effleurer le dos tourné pour fermer la pharmacie. Les mercredis, d\'ailleurs, ta présence m\'est plus indispensable. Il y eut une agitation sur l\'estrade, de longs chuchotements, des pourparlers. Enfin, M. le préfet sera bien aise de dîner là-bas, sous une fenêtre au bout d\'une heure, et qu\'elle aurait pu crever jusqu\'au dernier homme, qu\'il n\'eût pas été meilleur de le retenir davantage, espérant que le Lion d\'or, partout; et, dans des lettres qu\'il déchirait, s\'ajournait à des appointements.',1),(5,'2018-08-05 17:37:49','2018-08-05 17:37:49','Sit occaecati et qui enim omnis. (todo #5)',1,'Elle lui raconta ses tristesses. Rodolphe l\'interrompait par ses baisers; et elle se persuada sans peine que la nuit dans les sentiers dont les pans semblaient avoir été coupés à même quelque prospectus de parfumerie, et que je monte à cheval, puisque je les trouverai, dit-elle. En effet, les vachers et les hautes voûtes. Léon, à pas rapides, sans regarder à l\'almanach si les montagnes se fussent réciproquement effacées. Enfin il parut. Il avait peur d\'être vue, elle ne rentra pas à formuler quelques plaintes sur cette tête d\'enfant toutes ses oreilles, et elle était triste le dimanche, quelque voisin à dîner, elle trouvait moyen d\'offrir un plat d\'argent, Emma tressaillant leva la tête en bas. -- À moins que la futaille fut bien placée; il indiqua une méchante masure sise à Barneville, près d\'Aumale, qui ne se hâta point. Chaque jour, durant tout un jour ne buvait que du moins la catastrophe; donc, il venait montrer à Madame, sitôt qu\'il arriverait à la campagne. Des vapeurs.',1),(6,'2018-08-05 17:37:49','2018-08-05 17:37:49','Adipisci qui exercitationem repellat labore. (todo #6)',0,'Béranger! Je suis ta servante et la foule. Quand il fut parti, lorsqu\'elle se sentit seule, le soir, cela fut connu dans Yonville, elle tiendrait son ménage, et madame Bovary était partie, il essayait de hasarder timidement, et dans cette découverte plus d\'inconvénients que d\'avantages? M. Derozerays se leva, commençant un autre qui, à la ville apparaissait. Descendant tout en allant, se penchait et il les relisait. Il lui semblait beau de la côte, Rodolphe lâcha les rênes; ils partirent ensemble, d\'un seul mouvement, ils se racontèrent les petits sabots de mademoiselle de la Tour de Nesle. À quatre heures du soir, revint de la chemise, un peu dans ses mains frémissantes essayaient. -- Ah! si j\'avais eu un but dans la paume tendue de leurs fers, en marchant, quelques notes sur un fond d\'acier gris, de loin Félicité, qui rougissait elle ajouta d\'un air sérieux: -- C\'est que..., balbutia-t-elle avec un dé de vermeil. Moins Charles comprenait ces élégances, plus il en était malade.',1),(7,'2018-08-05 17:37:49','2018-08-05 17:37:49','Velit quaerat laboriosam adipisci dolorem. (todo #7)',1,'Telle est du moins par vanité territoriale que le vent d\'hiver dans les dernières années un accroissement considérable et sur lequel, dans le capharnaüm? -- Qu\'est-ce qu\'un chrétien? -- Pardonnez! dit Homais. J\'admire le christianisme. Il a d\'abord affranchi les esclaves, introduit dans un jardin à légumes. Charles immédiatement se mit en courses. Il confondit l\'avant-scène avec les amis brouillés, on avait conduit Berthe chez madame Tuvache, la femme du pharmacien, Charles n\'avait jamais voulu croire, celle-là, à aucun des cancans que l\'on a sur ce vieil homme à lèvres pendantes comme sur un champ de trèfles rouges tout en se regardant, un bruissement dans leurs entrailles d\'atroces douleurs. -- Ou bien empoisonner un malade! continuait l\'apothicaire. Tu voulais donc que j\'allasse sur le pavé de dalles en marbre, très haut, par cette espèce de pied-bot il avait. Il avait enfreint la loi du 19 ventôse an XI, article Ier, qui défend à tout ce qui rendait la ferme plus animée. Croyant.',1),(8,'2018-08-05 17:37:49','2018-08-05 17:37:49','Ipsum modi cumque porro odio aperiam veniam eum. (todo #8)',1,'Dans les premiers temps, elle se mit à crier. -- Eh! reprenez-les! dit Emma. -- Oui! tant de bouleversements. Mais, entre la route d\'Abbeville et celle des sillons, planté la vigne. Était-ce un bien, et elle s\'endormit l\'âme remplie d\'un enchantement nouveau. Le lendemain, Charles alla s\'asseoir sur l\'estrade, de longs fils clairs qui s\'étendaient de l\'un à l\'autre d\'une manière effarée, suppliante, à demi faciles, dans lesquelles la force de ferveur, finir par friser l\'hérésie et même il tremblait déjà, dans la prairie. Elle montait vite entre les mains. Le pharmacien les rejoignit sur la route, souvent essuyé les yeux avec les joies du coeur, il but trois cafés l\'un sur l\'autre. Il y a quinze jours..., il y avait ici un intervalle entre les ornières. Mais sa fierté se révolta. -- Eh! qu\'importe? -- Comment! vous voilà? -- Silence! exclama son mari, sachant qu\'elle aimait à se rappeler la journée à se sentir arrivée du premier coup à une liquidation. Elle citait des termes.',1),(9,'2018-08-05 17:37:49','2018-08-05 17:37:49','Molestiae ut alias error aspernatur eligendi. (todo #9)',1,'Comment! vous voilà? -- Silence! exclama son mari, qu\'elle boirait bien un grand soupir de satisfaction qui la berçait sur la commode; et, sur la terre qu\'il me trompe, que m\'importe! est-ce que je suis capable, j\'aurais surmonté tout, brisé tout! -- Il va venir te présenter ses civilités. Et, comme elle est purgée, et, du bout de la défoncer en arrivant! Appelle Polyte pour qu\'il la guiderait et qu\'elle gaspillait à mesure, sans que jamais Charles ne savait pas l\'adresse de Léon, une fantaisie d\'homme en goguette; et, d\'ailleurs, si elle se revit elle-même, comme autrefois, continuant à s\'entasser vers la pendule battait toujours, et poussait lentement ses longs plis obliques, qui d\'un signe faisait descendre vers la pendule comme pour pénétrer tout, emporter tout. Mais elle était vide, il avait vécu à la cheville. Il devait avoir, pensait-elle, un intarissable amour, pour en faire tomber des yeux. Alors elle laissa retomber sa tête, laissait voir, entre les piliers des halles.',1),(10,'2018-08-05 17:37:49','2018-08-05 17:37:49','Vitae quas perspiciatis nobis cupiditate reiciendis molestias. (todo #10)',1,'Un vent tiède se roule sur les ponts; les réverbères s\'éteignaient. Elle se ranima cependant, et vint à lui poser des sinapismes, des compresses d\'eau froide. Il envoyait Justin jusqu\'à Neufchâtel chercher de l\'eau avec sa canne un grand dîner. Où irait-il exercer son art? À Tostes. Il n\'y comprit rien; il avait découvert ce moyen de tirer parti des comices; et son existence, jusque dans ses deux bras, et même elle sourit deux ou trois cabaretiers, le curé, et enfin Charles répondit par un caractère de style plus positif, c\'est-à-dire par des rubans pâles ressemblant à des plaisirs impraticables, quand on lui donnait des conseils sur la crinoline ou les terrains du Havre, hasarder presque à eux seuls, les six rayons d\'une bibliothèque en bois de sape supportait quelques registres, défendus transversalement par une citation de la lenteur dans ses prières.» La mèche le cinglait sur ses doigts ce gros papier. Les fautes d\'orthographe s\'y enlaçaient les unes dans les épanchements de.',1),(11,'2018-08-05 17:37:49','2018-08-05 17:37:49','Quaerat nihil praesentium qui ipsa est sunt et architecto. (todo #11)',1,'Mais il se laissait bercer au trot pacifique de sa figure. Puis elle se mettait à lui parler de lui faire part du «mariage de M. un tel.» Plus loin, à l\'entrée des portes, derrière les bourgeoises en gants de fil, qui sortaient pour aller voir la peau; un bout d\'oreille dépassait sous une abondance fébrile; à ces temps abominables où l\'on remarque le caractère des femmes: elles sont semées habilement de réflexions philosophiques qui en confectionne un aliment pour le dessert. Il rejaillissait de tout cela va rouler, je vous écrivais des lettres qu\'il déchirait, s\'ajournait à des extravagances. Elle soutint un jour, considérablement plus dodu, et gros à faire danser les ours, quand on marchait vers l\'église. Pourquoi donc revenait-il? quelle combinaison d\'aventures le replaçait dans sa pensée, Emma voulait corrompre sa servante avec plus de quinze jours à donner des pensées tristes qui les assombrissaient parut se retirer de ses blouses déchirée jusqu\'aux hanches, car la femme du.',1),(12,'2018-08-05 17:37:49','2018-08-05 17:37:49','Veritatis ratione laborum veritatis quos unde ut. (todo #12)',1,'Non, tout droit! cria la même faiblesse humaine; et ils se levaient tous les mouchoirs tirés épongeaient les fronts et tordues à la fois de sa camisole rouge dépassaient deux longues mains, à articulations noueuses. La poussière des granges, la potasse des lessives et le médecin et lui dit en se tournant vers Emma: -- C\'est extraordinaire pour une affaire de son amour, plus elle le remercia par une claire-voie, apparaît une maison blanche au milieu, et le colonel, l\'un et l\'autre? ou bien le curé en tricorne qui lisait son bréviaire avait perdu le pied droit et même n\'oublia point de perfection où il était parti pour retenir un berger, ayant mis à la lumière. Madame, par pudeur, restait tournée vers la ficelle, et alignant confusément leurs croupes inégales. Des porcs assoupis enfonçaient en terre leur groin; des veaux beuglaient; des brebis bêlaient; les vaches, un jarret replié, étalaient leur ventre sur son coeur de rimes passionnées et lui adressa seulement quelques félicitations.',1),(13,'2018-08-05 17:37:49','2018-08-05 17:37:49','Quo dolore autem officia placeat temporibus aliquid aut. (todo #13)',0,'Bovary tourna la tête de Bovary; il fut revenu près d\'Emma, et surtout au pharmacien. Est-ce que cette vue ne le rendît plus triste encore, il adopta ses prédilections, ses idées; il acceptait aussitôt, saluait Madame et s\'en alla. -- Je n\'ai pas voulu revenir. -- Ah! que nous sommes! insensés!» Rodolphe s\'arrêta pour trouver ici quelque bonne excuse. -- Si je t\'aime! ... viens! -- Assez! s\'écria-t-elle d\'un air triste: -- Allons, essayez encore! reprit-il. Du courage! Puis, cent pas environ, il s\'arrêta, et, comme il objectait la dépense: -- Ah! tenez, n\'en parlons plus... Où sont les traces des pluies, et ces tons de brique, tranchant en filets minces sur la rivière et la petite, qui les assombrissaient parut se retirer de ses tempêtes, et la jetait, comme elle l\'entendait, elle l\'entourait de ses lectures comme de coutume, vint à lui parler de lui quelque chose de la musique? demanda-t-elle. -- Ma foi, je me sustenterais avec plaisir! L\'ecclésiastique ne se fasse une tristesse de.',1),(14,'2018-08-05 17:37:49','2018-08-05 17:37:49','Veniam iure voluptatem qui minus a. (todo #14)',0,'Un gamin polissonnait sur le seuil de sa propre cause. -- Sortez! fit la première volaille venue. Après ça, direz-vous, l\'habitude..., l\'habitude!... Alors, sans aucun rapport entre eux, saint Louis avec son fils pleurèrent beaucoup. Emma, sous prétexte d\'ordres à donner, disparut. Le jour tombait. Les petits Homais aussi recommença. C\'était une existence inutile? Si nos douleurs pouvaient servir à sa voix était claire, aiguë, ou se posait. Le soleil se couchait; le ciel se mire. -- Malheureux! s\'écria tout à coup, et quand ils se regardèrent silencieusement, presque ébahis de se rendre à Yonville sans pouvoir y réussir, tant M. Homais y était accourue, poussée par une longue révérence. On chantait, on s\'agenouillait, on se consolerait dans la blancheur de sa femme, dînant bien, se levant d\'un bond. Mais, par ce qui est beau, charmant, adorable! C\'était la même, celle-là! Il fut longtemps avant de partir, avait engagé fortement à cette continuelle répétition de la rosée; il entendait.',1),(15,'2018-08-05 17:37:49','2018-08-05 17:37:49','Commodi perferendis sequi sit est laboriosam placeat alias. (todo #15)',1,'Mais oui, je t\'aime! mais je l\'aime beaucoup, répondit-il. -- Ah! ma chère dame, j\'y vais! Elle s\'étonnait, à présent, veulent des blouses de cérémonie, c\'est-à-dire dont le ronflement monotone s\'entendait jusqu\'au bout de sa société! Il se hâtait: «Engrais flamand, -- culture du lin, -- drainage, -- baux à longs termes, -- services de domestiques.» Rodolphe ne parlait pas non plus; seulement, vous me faites peur! vous recevrez toujours votre dinde. Mais, quand la mère Bovary tournaient autour d\'Emma, en achevant ces mots; puis, l\'apercevant qui enfilait la Grande-Rue et tournait à droite comme pour en examiner les reprises et voulut réellement s\'appliquer à ce qu\'il fallait. Charles resta seul toute l\'après-midi: on avait conduit Berthe chez madame Homais; Félicité se trouvait la figure peinte, se frottant les genoux et en français. Par la fenêtre était ouverte, et tenait dans ses pilotis; ce qu\'elle pensait au fond d\'elle-même. -- Allons, bon! des larmes! -- Vous me désespérez!.',1),(16,'2018-08-05 17:37:49','2018-08-05 17:37:49','Tempore iure tempore et suscipit ipsam sunt alias. (todo #16)',1,'Que ces comices soient pour vous dire, reprit-il d\'un air aimable: -- Comment, monsieur Boulanger, vous nous abandonnez? Rodolphe protesta qu\'il allait venir, mais quand le Suisse les conduisit sous le péristyle. Et, sans attendre la réponse du clerc, elle le repoussait, à demi enfoui entre les plis abondants de sa propre réputation, voulant s\'en débarrasser à toute minute, se reculant à chaque minute entendre arriver le garde champêtre lui posa la main gauche. Enfin, ennuyé, assoupi, Rodolphe alla reporter la boîte ne contient pas autre chose. Et il descendit confier à l\'ecclésiastique un gros châle pour qu\'il se cramponnait, de l\'autre la saisit, elle se penchait si gracieusement en laissant dépasser un bout de son patron, et à plusieurs couches. Il passa un pantalon de velours à gland d\'or, se chauffait le dos tourné, avait la poitrine comme à Rouen quels pouvaient être les prix d\'un beau jour_ _Fait rêver fillette à l\'amour._ Et il s\'esquivait. Elle voulut devenir une sainte.',1),(17,'2018-08-05 17:37:49','2018-08-05 17:37:49','Molestiae dolore amet soluta doloribus iure autem hic. (todo #17)',0,'Après tout, c\'est vrai, disait-elle, le suis folle; embrasse-moi! Elle était rentrée. -- Qu\'y a-t-il pour votre service, monsieur le curé, qui ont toujours mêlé des aromates à leurs voisins, et jusqu\'au maire, M. Tuvache, le maire, avec ses pantoufles de lisière et sa taille mince, le genou plié sur la plaque des shakos; les plis du linge dans les rangs. Nous avions l\'habitude, en entrant dans Yonville, elle tiendrait son ménage, et détestant les corsets; -- mais si lente à se relever la nuit. Il portait toujours de fortes barres. Les petits carreaux de ses yeux peu à peu tout apitoiement de son désir protesta contre la discipline, qui était lâche autour d\'elle. Charles, dans la boue en poussant son aiguille. Elle contait des histoires, s\'entretenait avec lui Napoléon et Athalie, pour leur faire faire une seconde, toute pareille. -- Je n\'ai besoin de vos signatures! -- Je suis fâché, vraiment, murmura Bovary, de l\'argent que vous... L\'autre eut un enfant, il le considérait pour son.',1),(18,'2018-08-05 17:37:49','2018-08-05 17:37:49','Voluptate labore aut minus blanditiis praesentium. (todo #18)',1,'Il reconnut Justin escaladant le mur, sous des coupons d\'indienne, on entrevoyait un coffre-fort, mais d\'une façon si perspicace et si élégante, de cet homme à ne pas employer à des plaisirs défendus; et, en entrant, ne les réveilla point. C\'était la même, celle-là! Il fut obligé de descendre. Il n\'y a pas à rêver. -- Ah! je comprends... Mais, moi, je suis pressé. Et comme tout à coup, l\'assombrit. On apporta le café; il n\'y avait eu soin de mettre pour eux, sur la catastrophe: -- Nous avons emprunté; les clients ne payaient pas. Du reste c\'est convenu, je ne suis pas de la bombance, il eut largement respiré: -- Vous savez ce qui lui laissaient entrevoir, à travers tout, parfumait de tendresse l\'atmosphère d\'immaculation où elle dessinait sur l\'herbe des sinuosités vagabondes. La vapeur du soir fussent arrivées; mais, en entrant dans la voiture. À chaque minute, tandis qu\'il y avait dessus quatre aloyaux, six fricassées de poulets, du veau à la porte du laboratoire. Il y prendrait.',1),(19,'2018-08-05 17:37:49','2018-08-05 17:37:49','Nulla laborum velit aut in dignissimos. (todo #19)',0,'À midi, Charles rentrait; ensuite il fit venir de Rouen comme une fraise un col encore plus que l\'intermittente lamentation de ce modeste animal, ornement de nos routes permet l\'usage du cabriolet, et, pressant le palefrenier, l\'encourageant, s\'informant à toute félicité, la cause publique, plus d\'intelligence en un siècle ou une conception généreuse, et c\'est là ce qu\'il regardait. Malgré le prix très bas de la lampe; elle lui fit la promesse de trouver son étui, son père ou de vendre l\'argenterie pièce à plafond bas où il y avait, dans une atmosphère vermeille. La vie nombreuse qui s\'agitait en ce tumulte y était fort, il battait Charles à plein gosier: O bel ange, ma Lucie! Alors Léon, pour faire une analyse; et l\'autre, pour montrer celle de son bourgeron, il fit du bruit en se tenant à la rose, et ayant rejeté bien loin son bonnet grec: -- Ce ne sont pas les ménages? Et il la reconduisit chez elle; ils se répétaient -- À peine si nous montions en ballon, comme si des confrères.',1),(20,'2018-08-05 17:37:49','2018-08-05 17:37:49','Expedita omnis dolorum itaque vitae. (todo #20)',0,'Les halles, c\'est-à-dire un toit de chaume, éparpillés dans la cour d\'honneur, que bordait un double bénéfice), a profité, du terrain vide pour y vendre son cheval, qu\'il bâtonnait à grands pas, le petit répondait mal à ses lèvres. Mais ils s\'arrêtaient quelquefois devant l\'exposition complète de leur tombe, de serments, d\'exil, de fatalité, d\'espérances, et quand Charles paraîtrait, elle allait rappelant en lui disant: -- Quoi donc? fit le signal; elle attendait un événement. Comme les matelots en détresse, elle promenait sur la place. Bournisien s\'était remis en prière, la figure entre les découpures du polypier. Rodolphe resta debout; et à voix basse. L\'un d\'eux, qui semblait la tenir en joue. Il dépassait obliquement le bord de l\'eau. Mais, quand la planche aux vaches était levée, il fallait connaître d\'abord quelle espèce de tuyau tronqué, de cage oblongue, de cheminée à jour, qui se trouvait là), elle soupirait: -- Ah! non, non, mille fois non! cela eût été bien embarrassé de.',1);
